        <div>
            <h1 className='blurb__title'>Skills</h1> 
            <p className='blurb__content'>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus mollis lobortis lectus, sit amet tempus nunc maximus in. Pellentesque lobortis lorem quis porttitor maximus. Integer dictum ultrices lacus, quis ultricies turpis fringilla a. Vestibulum vehicula tincidunt faucibus. Proin tempor, odio in semper pulvinar, augue nisi malesuada tortor, in luctus lectus turpis a massa. Praesent fermentum pharetra lacus vel rhoncus. In nec odio ligula</p>
        </div>
    );
}

export default SkillsBlurb;
